A\" title=\"\u0421\u0440\u0435\u0434\u043d\u0435\u043a\u043e\u043b\u044b\u043c\u0441\u043a\">\u0421\u0440\u0435\u0434\u043d\u0435\u043a\u043e\u043b\u044b\u043c\u0441\u043a<\/a> \u0434\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u044b \u043f\u0435\u0440\u0432\u044b\u0439 \u0432\u0438\u0446\u0435-\u043a\u0430\u043d\u0446\u043b\u0435\u0440 \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0438\u0445 \u0434\u0435\u043b \u0420\u043e\u0441\u0441\u0438\u0438 \u0433\u0440\u0430\u0444 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BB%D0%BE%D0%B2%D0%BA%D0%B8%D0%BD,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%93%D0%B0%D0%B2%D1%80%D0%B8%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0413\u043e\u043b\u043e\u0432\u043a\u0438\u043d, \u041c\u0438\u0445\u0430\u0438\u043b \u0413\u0430\u0432\u0440\u0438\u043b\u043e\u0432\u0438\u0447\">\u041c.&#160;\u0413.&#160;\u0413\u043e\u043b\u043e\u0432\u043a\u0438\u043d<\/a> \u0441 \u0436\u0435\u043d\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BB%D0%BE%D0%B2%D0%BA%D0%B8%D0%BD%D0%B0,_%D0%95%D0%BA%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B0_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%BD%D0%B0\" title=\"\u0413\u043e\u043b\u043e\u0432\u043a\u0438\u043d\u0430, \u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 \u0418\u0432\u0430\u043d\u043e\u0432\u043d\u0430\">\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u043e\u0439 \u0418\u0432\u0430\u043d\u043e\u0432\u043d\u043e\u0439<\/a>, \u043d\u0430\u043a\u0430\u0437\u0430\u043d\u043d\u044b\u0435 \u0437\u0430 \u0441\u043e\u0447\u0443\u0432\u0441\u0442\u0432\u0438\u0435 \u043f\u0440\u0438\u043d\u0446\u0435\u0441\u0441\u0435 \u0410\u043d\u043d\u0435 \u041b\u0435\u043e\u043f\u043e\u043b\u044c\u0434\u043e\u0432\u043d\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1786_%D0%B3%D0%BE%D0%B4\" title=\"1786 \u0433\u043e\u0434\">1786 \u0433\u043e\u0434<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BB%D1%8C%D0%BC%D0%B0,_%D0%96%D0%B0%D0%BA\" title=\"\u0411\u0430\u043b\u044c\u043c\u0430, \u0416\u0430\u043a\">\u0416\u0430\u043a \u0411\u0430\u043b\u044c\u043c\u0430<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BA%D0%BA%D0%B0%D1%80%D0%B4,_%D0%9C%D0%B8%D1%88%D0%B5%D0%BB%D1%8C-%D0%93%D0%B0%D0%B1%D1%80%D0%B8%D1%8D%D0%BB%D1%8C\" title=\"\u041f\u0430\u043a\u043a\u0430\u0440\u0434, \u041c\u0438\u0448\u0435\u043b\u044c-\u0413\u0430\u0431\u0440\u0438\u044d\u043b\u044c\">\u041c\u0438\u0448\u0435\u043b\u044c \u041f\u0430\u043a\u043a\u0430\u0440\u0434<\/a> \u043f\u0435\u0440\u0432\u044b\u043c\u0438 \u043f\u043e\u043a\u043e\u0440\u0438\u043b\u0438 \u0432\u044b\u0441\u043e\u0447\u0430\u0439\u0448\u0443\u044e \u0432\u0435\u0440\u0448\u0438\u043d\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8C%D0%BF%D1%8B\" title=\"\u0410\u043b\u044c\u043f\u044b\">\u0410\u043b\u044c\u043f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D0%B1%D0%BB%D0%B0%D0%BD\" title=\"\u041c\u043e\u043d\u0431\u043b\u0430\u043d\">\u041c\u043e\u043d\u0431\u043b\u0430\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1788_%D0%B3%D0%BE%D0%B4\" title=\"1788 \u0433\u043e\u0434\">1788 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0439 \u043a\u043e\u0440\u043e\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8E%D0%B4%D0%BE%D0%B2%D0%B8%D0%BA_XVI_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D0%B8)\" class=\"mw-redirect\" title=\"\u041b\u044e\u0434\u043e\u0432\u0438\u043a XVI (\u043a\u043e\u0440\u043e\u043b\u044c \u0424\u0440\u0430\u043d\u0446\u0438\u0438)\">\u041b\u044e\u0434\u043e\u0432\u0438\u043a XVI<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u0441\u043e\u0437\u044b\u0432 \u043d\u0430 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0439 \u0433\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B5_%D1%88%D1%82%D0%B0%D1%82%D1%8B_(%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F)\" title=\"\u0413\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0435 \u0448\u0442\u0430\u0442\u044b (\u0424\u0440\u0430\u043d\u0446\u0438\u044f)\">\u0413\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0445 \u0448\u0442\u0430\u0442\u043e\u0432<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043f\u043e\u0437\u0436\u0435 \u0432\u043e\u0437\u0432\u0435\u0434\u0443\u0442 \u0435\u0433\u043e \u043d\u0430 \u043f\u043b\u0430\u0445\u0443.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1805_%D0%B3%D0%BE%D0%B4\" title=\"1805 \u0433\u043e\u0434\">1805 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0422\u0438\u043c\u043e\u0444\u0435\u0439 \u041a\u043e\u043d\u0434\u0440\u0430\u0442\u044c\u0435\u0432 \u0441\u0442\u0430\u043b \u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0438\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D1%85%D0%B8%D1%82%D0%B5%D0%BA%D1%82%D0%BE%D1%80\" title=\"\u0410\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u043e\u0440\">\u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u043e\u0440\u043e\u043c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%80%D0%BE%D0%BD%D0%B5%D0%B6\" title=\"\u0412\u043e\u0440\u043e\u043d\u0435\u0436\">\u0412\u043e\u0440\u043e\u043d\u0435\u0436\u0430<\/a>. \u0412 \u0433\u043e\u0440\u043e\u0434\u0435 \u044d\u0442\u0430 \u0434\u043e\u043b\u0436\u043d\u043e\u0441\u0442\u044c \u0431\u044b\u043b\u0430 \u0432\u0432\u0435\u0434\u0435\u043d\u0430 \u0432\u043f\u0435\u0440\u0432\u044b\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1815_%D0%B3%D0%BE%D0%B4\" title=\"1815 \u0433\u043e\u0434\">1815 \u0433\u043e\u0434<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I_%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82\" class=\"mw-redirect\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d<\/a> \u043e\u0442\u043f\u0440\u0430\u0432\u0438\u043b\u0441\u044f \u0432 \u0441\u0441\u044b\u043b\u043a\u0443 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D1%82%D1%80%D0%BE%D0%B2_%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B9_%D0%95%D0%BB%D0%B5%D0%BD%D1%8B\" title=\"\u041e\u0441\u0442\u0440\u043e\u0432 \u0421\u0432\u044f\u0442\u043e\u0439 \u0415\u043b\u0435\u043d\u044b\">\u043e\u0441\u0442\u0440\u043e\u0432 \u0421\u0432\u044f\u0442\u043e\u0439 \u0415\u043b\u0435\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1832_%D0%B3%D0%BE%D0%B4\" title=\"1832 \u0433\u043e\u0434\">1832 \u0433\u043e\u0434<\/a>&#160;\u2014 \u043f\u0440\u0438\u043d\u0446 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%82%D1%82%D0%BE%D0%BD_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%93%D1%80%D0%B5%D1%86%D0%B8%D0%B8)\" class=\"mw-redirect\" title=\"\u041e\u0442\u0442\u043e\u043d (\u043a\u043e\u0440\u043e\u043b\u044c \u0413\u0440\u0435\u0446\u0438\u0438)\">\u041e\u0442\u0442\u043e<\/a>, \u0441\u044b\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B2%D0%B0%D1%80%D0%B8%D1%8F\" title=\"\u0411\u0430\u0432\u0430\u0440\u0438\u044f\">\u0431\u0430\u0432\u0430\u0440\u0441\u043a\u043e\u0433\u043e<\/a> \u043a\u043e\u0440\u043e\u043b\u044f, \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0451\u043d \u043a\u043e\u0440\u043e\u043b\u0451\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0413\u0440\u0435\u0446\u0438\u044f\">\u0413\u0440\u0435\u0446\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1835_%D0%B3%D0%BE%D0%B4\" title=\"1835 \u0433\u043e\u0434\">1835 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u043f\u0440\u0438\u043d\u044f\u0442 \u043d\u043e\u0432\u044b\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0441\u043a\u0438\u0439 \u0443\u0441\u0442\u0430\u0432, \u0440\u0430\u0437\u0440\u0430\u0431\u043e\u0442\u0430\u043d\u043d\u044b\u0439 \u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u043c \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0433\u043e \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f \u0433\u0440\u0430\u0444\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%B2%D0%B0%D1%80%D0%BE%D0%B2,_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B9_%D0%A1%D0%B5%D0%BC%D1%91%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0423\u0432\u0430\u0440\u043e\u0432, \u0421\u0435\u0440\u0433\u0435\u0439 \u0421\u0435\u043c\u0451\u043d\u043e\u0432\u0438\u0447\">\u0421.&#160;\u0421.&#160;\u0423\u0432\u0430\u0440\u043e\u0432\u044b\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1854_%D0%B3%D0%BE%D0%B4\" title=\"1854 \u0433\u043e\u0434\">1854 \u0433\u043e\u0434<\/a>&#160;\u2014 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Smith_%26_Wesson\" title=\"Smith &amp; Wesson\">Smith &amp; Wesson<\/a> \u043d\u0430\u0447\u0430\u043b\u0430 \u0432\u044b\u043f\u0443\u0441\u043a \u043f\u0430\u0442\u0440\u043e\u043d\u043d\u044b\u0445 \u043c\u0430\u0433\u0430\u0437\u0438\u043d\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1899_%D0%B3%D0%BE%D0%B4\" title=\"1899 \u0433\u043e\u0434\">1899 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0438\u0437\u043e\u0431\u0440\u0435\u0442\u0430\u0442\u0435\u043b\u044c \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%BD%D0%BD%D0%B5%D1%81%D0%BE%D1%82%D0%B0\" title=\"\u041c\u0438\u043d\u043d\u0435\u0441\u043e\u0442\u0430\">\u041c\u0438\u043d\u043d\u0435\u0441\u043e\u0442\u044b<\/a> \u0410\u043b\u044c\u0431\u0435\u0440\u0442 \u041c\u0430\u0440\u0448\u0430\u043b\u043b \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b \u0445\u043e\u043b\u043e\u0434\u0438\u043b\u044c\u043d\u0438\u043a .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1900_%D0%B3%D0%BE%D0%B4\" title=\"1900 \u0433\u043e\u0434\">1900 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0432 \u0411\u0440\u0443\u043a\u043b\u0430\u0439\u043d\u0435 (\u0448\u0442\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%81%D1%81%D0%B0%D1%87%D1%83%D1%81%D0%B5%D1%82%D1%81\" title=\"\u041c\u0430\u0441\u0441\u0430\u0447\u0443\u0441\u0435\u0442\u0441\">\u041c\u0430\u0441\u0441\u0430\u0447\u0443\u0441\u0435\u0442\u0441<\/a>) \u043d\u0430 \u043f\u043b\u043e\u0449\u0430\u0434\u043a\u0435 \u041b\u043e\u043d\u0433\u0432\u0443\u0434\u0441\u043a\u043e\u0433\u043e \u043a\u0440\u0438\u043a\u0435\u0442\u043d\u043e\u0433\u043e \u043a\u043b\u0443\u0431\u0430 \u043d\u0430\u0447\u0430\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u043c\u0430\u0442\u0447 \u0437\u0430 \u041a\u0443\u0431\u043e\u043a \u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u043e\u0439 \u0444\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438 \u043b\u0430\u0443\u043d-\u0442\u0435\u043d\u043d\u0438\u0441\u0430. \u0421\u0430\u043c \u043a\u0443\u0431\u043e\u043a \u0431\u044b\u043b \u043f\u043e\u0434\u0430\u0440\u0435\u043d \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0446\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%8D%D0%B2%D0%B8%D1%81,_%D0%94%D1%83%D0%B0%D0%B9%D1%82\" class=\"mw-redirect\" title=\"\u0414\u044d\u0432\u0438\u0441, \u0414\u0443\u0430\u0439\u0442\">\u0414\u0443\u0430\u0439\u0442\u043e\u043c \u0414\u044d\u0432\u0438\u0441\u043e\u043c<\/a>, \u043f\u043e \u0438\u043c\u0435\u043d\u0438 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u0438 \u0441\u0432\u043e\u0451 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u0438 \u0441\u0430\u043c\u0438 \u0441\u043e\u0441\u0442\u044f\u0437\u0430\u043d\u0438\u044f.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1901_%D0%B3%D0%BE%D0%B4\" title=\"1901 \u0433\u043e\u0434\">1901 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0432 \u042e\u0436\u043d\u043e\u0439 \u0410\u0444\u0440\u0438\u043a\u0435 \u043a\u0430\u043f\u0438\u0442\u0443\u043b\u0438\u0440\u043e\u0432\u0430\u043b \u043a\u043e\u043c\u0430\u043d\u0434\u0443\u044e\u0449\u0438\u0439 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%BE-%D0%B1%D1%83%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1899%E2%80%941902)\" title=\"\u0410\u043d\u0433\u043b\u043e-\u0431\u0443\u0440\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1899\u20141902)\">\u0431\u0443\u0440\u043e\u0432<\/a> \u0414\u0435 \u0412\u0438\u043b\u043b\u044c\u0435\u0440\u0441.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1907_%D0%B3%D0%BE%D0%B4\" title=\"1907 \u0433\u043e\u0434\">1907 \u0433\u043e\u0434<\/a>&#160;\u2014 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u0438 \u0440\u0443\u0441\u0441\u043a\u043e\u0433\u043e \u0417\u0435\u043c\u0441\u0442\u0432\u0430 \u043f\u043e\u0442\u0440\u0435\u0431\u043e\u0432\u0430\u043b\u0438 \u043e\u0442 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 \u0432\u0432\u0435\u0434\u0435\u043d\u0438\u044f \u0432\u0441\u0435\u043e\u0431\u0449\u0435\u0433\u043e \u043e\u0431\u044f\u0437\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1910_%D0%B3%D0%BE%D0%B4\" title=\"1910 \u0433\u043e\u0434\">1910 \u0433\u043e\u0434<\/a>&#160;\u2014 \u043f\u0435\u0440\u0441\u0438\u0434\u0441\u043a\u0438\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u0437\u0430\u0445\u0432\u0430\u0442\u0438\u043b\u0438 \u043b\u0438\u0434\u0435\u0440\u043e\u0432 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D1%81%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u041f\u0435\u0440\u0441\u0438\u044f\">\u041f\u0435\u0440\u0441\u0438\u0438<\/a> \u0421\u0430\u0442\u0442\u0430\u0440-\u0445\u0430\u043d\u0430 \u0438 \u0411\u0435\u0433\u0438\u0440-\u0445\u0430\u043d\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1911_%D0%B3%D0%BE%D0%B4\" title=\"1911 \u0433\u043e\u0434\">1911 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u044f \u0440\u0430\u0431\u043e\u0447\u0438\u0445 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B2%D0%B5%D1%80%D0%BF%D1%83%D0%BB%D1%8C\" title=\"\u041b\u0438\u0432\u0435\u0440\u043f\u0443\u043b\u044c\">\u041b\u0438\u0432\u0435\u0440\u043f\u0443\u043b\u0435<\/a> \u0440\u0430\u0441\u0441\u0442\u0440\u0435\u043b\u044f\u043d\u0430 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1914_%D0%B3%D0%BE%D0%B4\" title=\"1914 \u0433\u043e\u0434\">1914 \u0433\u043e\u0434<\/a><ul><li>\u0420\u0430\u0437\u043b\u0438\u0447\u043d\u044b\u0435 \u0444\u0440\u0430\u043a\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%B4%D1%83%D0%BC%D0%B0_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D0%B8\" title=\"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0434\u0443\u043c\u0430 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438\">\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0414\u0443\u043c\u044b \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a> \u0437\u0430\u043a\u043b\u044e\u0447\u0438\u043b\u0438 \u0421\u0432\u044f\u0449\u0435\u043d\u043d\u044b\u0439 \u0441\u043e\u044e\u0437 \u043d\u0430 \u043f\u0435\u0440\u0438\u043e\u0434 \u043f\u0435\u0440\u0432\u043e\u0439 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0432\u043e\u0439\u043d\u044b.<\/li><li>\u0410\u043d\u0433\u043b\u043e-\u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u043e\u043a\u043a\u0443\u043f\u0438\u0440\u043e\u0432\u0430\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%B3%D0%BE\" title=\"\u0422\u043e\u0433\u043e\">\u0422\u043e\u0433\u043e\u043b\u0435\u043d\u0434<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1915_%D0%B3%D0%BE%D0%B4\" title=\"1915 \u0433\u043e\u0434\">1915 \u0433\u043e\u0434<\/a><ul><li>\u041d\u0435\u043c\u0435\u0446\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u0437\u0430\u0445\u0432\u0430\u0442\u0438\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B0%D0%B3%D0%B0_(%D0%92%D0%B0%D1%80%D1%88%D0%B0%D0%B2%D0%B0)\" title=\"\u041f\u0440\u0430\u0433\u0430 (\u0412\u0430\u0440\u0448\u0430\u0432\u0430)\">\u041f\u0440\u0430\u0433\u0443<\/a>, \u0443\u043a\u0440\u0435\u043f\u043b\u0451\u043d\u043d\u043e\u0435 \u043f\u0440\u0435\u0434\u043c\u0435\u0441\u0442\u044c\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%80%D1%88%D0%B0%D0%B2%D0%B0\" title=\"\u0412\u0430\u0440\u0448\u0430\u0432\u0430\">\u0412\u0430\u0440\u0448\u0430\u0432\u044b<\/a>.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D1%80%D0%B4%D0%B0%D0%BD%D0%B5%D0%BB%D0%BB%D1%8B\" title=\"\u0414\u0430\u0440\u0434\u0430\u043d\u0435\u043b\u043b\u044b\">\u0414\u0430\u0440\u0434\u0430\u043d\u0435\u043b\u043b\u0430\u0445<\/a> \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u0439 \u043f\u043e\u0434\u043b\u043e\u0434\u043a\u043e\u0439 \u0437\u0430\u0442\u043e\u043f\u043b\u0435\u043d \u0442\u0443\u0440\u0435\u0446\u043a\u0438\u0439 \u043b\u0438\u043d\u043a\u043e\u0440 \u00ab\u0411\u0430\u0440\u0431\u0430\u0440\u043e\u0441\u0441\u0430\u00bb.<\/li><li>\u0420\u0443\u0441\u0441\u043a\u0438\u0439 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_II\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 II\">\u041d\u0438\u043a\u043e\u043b\u0430\u0439 II<\/a> \u043e\u0442\u0432\u0435\u0440\u0433 \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0414\u0430\u043d\u0438\u044f\">\u0414\u0430\u043d\u0438\u0438<\/a> \u0441\u0442\u0430\u0442\u044c \u043f\u043e\u0441\u0440\u0435\u0434\u043d\u0438\u043a\u043e\u043c \u0432 \u043c\u0438\u0440\u043d\u044b\u0445 \u043f\u0435\u0440\u0435\u0433\u043e\u0432\u043e\u0440\u0430\u0445 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0435\u0439<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917 \u0433\u043e\u0434<\/a><ul><li>\u041d\u0430\u0447\u0430\u043b\u0441\u044f VI \u0441\u044a\u0435\u0437\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D1%81%D0%BE%D1%86%D0%B8%D0%B0%D0%BB-%D0%B4%D0%B5%D0%BC%D0%BE%D0%BA%D1%80%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B0%D0%B1%D0%BE%D1%87%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_(%D0%B1%D0%BE%D0%BB%D1%8C%D1%88%D0%B5%D0%B2%D0%B8%D0%BA%D0%BE%D0%B2)\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0441\u043e\u0446\u0438\u0430\u043b-\u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0440\u0430\u0431\u043e\u0447\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f (\u0431\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u043a\u043e\u0432)\">\u043f\u0430\u0440\u0442\u0438\u0438 \u0431\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u043a\u043e\u0432<\/a>, \u0432\u0437\u044f\u0432\u0448\u0438\u0439 \u043a\u0443\u0440\u0441 \u043d\u0430 \u0432\u043e\u043e\u0440\u0443\u0436\u0451\u043d\u043d\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435.<\/li><li>\u0412 \u0420\u043e\u0441\u0441\u0438\u0438 \u0441\u043d\u044f\u0442 \u0437\u0430\u043f\u0440\u0435\u0442 \u043d\u0430 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B5%D0%B7%D1%83%D0%B8%D1%82%D1%8B\" title=\"\u0418\u0435\u0437\u0443\u0438\u0442\u044b\">\u043e\u0440\u0434\u0435\u043d\u0430 \u0438\u0435\u0437\u0443\u0438\u0442\u043e\u0432<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918 \u0433\u043e\u0434<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BC%D1%8C%D0%B5%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u0410\u043c\u044c\u0435\u043d\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f\">\u0410\u043c\u044c\u0435\u043d\u0441\u043a\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f<\/a> \u0430\u043d\u0433\u043b\u043e-\u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0445 \u0432\u043e\u0439\u0441\u043a (\u00ab\u0427\u0451\u0440\u043d\u044b\u0439 \u0434\u0435\u043d\u044c \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438\u00bb).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919 \u0433\u043e\u0434<\/a><ul><li>\u0417\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B5%D1%82%D1%8C%D1%8F_%D0%B0%D0%BD%D0%B3%D0%BB%D0%BE-%D0%B0%D1%84%D0%B3%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0422\u0440\u0435\u0442\u044c\u044f \u0430\u043d\u0433\u043b\u043e-\u0430\u0444\u0433\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0442\u0440\u0435\u0442\u044c\u044f \u0430\u043d\u0433\u043b\u043e-\u0430\u0444\u0433\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>.<\/li><li>\u041f\u043e\u043b\u044c\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u0437\u0430\u0445\u0432\u0430\u0442\u0438\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%BD%D1%81%D0%BA\" title=\"\u041c\u0438\u043d\u0441\u043a\">\u041c\u0438\u043d\u0441\u043a<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D0%B2%D0%BD%D0%BE\" title=\"\u0420\u043e\u0432\u043d\u043e\">\u0420\u043e\u0432\u043d\u043e<\/a>.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%8E%D0%BC%D0%B5%D0%BD%D1%8C\" title=\"\u0422\u044e\u043c\u0435\u043d\u044c\">\u0422\u044e\u043c\u0435\u043d\u0438<\/a> \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0430 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f \u0432\u043b\u0430\u0441\u0442\u044c.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920 \u0433\u043e\u0434<\/a>&#160;\u2014 \u043e\u0442\u0440\u044f\u0434 \u0432\u043e\u0439\u0441\u043a \u0431\u0430\u0440\u043e\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%80%D0%B0%D0%BD%D0%B3%D0%B5%D0%BB%D1%8C,_%D0%9F%D1%91%D1%82%D1%80_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0412\u0440\u0430\u043d\u0433\u0435\u043b\u044c, \u041f\u0451\u0442\u0440 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447\">\u0412\u0440\u0430\u043d\u0433\u0435\u043b\u044f<\/a> \u0432\u044b\u0441\u0430\u0434\u0438\u043b\u0441\u044f \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D0%B1%D0%B0%D0%BD%D1%8C_(%D1%80%D0%B5%D0%B3%D0%B8%D0%BE%D0%BD)\" title=\"\u041a\u0443\u0431\u0430\u043d\u044c (\u0440