D1%8F%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%B0%D1%8F_%D0%B0%D1%80%D0%BC%D0%B8%D1%8F\" title=\"\u0420\u0430\u0431\u043e\u0447\u0435-\u043a\u0440\u0435\u0441\u0442\u044c\u044f\u043d\u0441\u043a\u0430\u044f \u041a\u0440\u0430\u0441\u043d\u0430\u044f \u0430\u0440\u043c\u0438\u044f\">\u0420\u0430\u0431\u043e\u0447\u0435-\u043a\u0440\u0435\u0441\u0442\u044c\u044f\u043d\u0441\u043a\u043e\u0439 \u041a\u0440\u0430\u0441\u043d\u043e\u0439 \u0410\u0440\u043c\u0438\u0438<\/a> \u043f\u0440\u0438\u043d\u0438\u043c\u0430\u0435\u0442\u0441\u044f \u0442\u044f\u0436\u0451\u043b\u044b\u0439 \u0442\u0430\u043d\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%92-85\" title=\"\u041a\u0412-85\">\u041a\u0412-85<\/a><\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1944_%D0%B3%D0%BE%D0%B4\" title=\"1944 \u0433\u043e\u0434\">1944 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD\" title=\"\u0411\u0435\u0440\u043b\u0438\u043d\">\u0411\u0435\u0440\u043b\u0438\u043d\u0435<\/a> \u0432\u043e\u0441\u0435\u043c\u044c \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u0445 \u043e\u0444\u0438\u0446\u0435\u0440\u043e\u0432, \u043e\u0431\u0432\u0438\u043d\u0451\u043d\u043d\u044b\u0445 \u0432 \u043f\u043e\u0434\u0433\u043e\u0442\u043e\u0432\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%B3%D0%BE%D0%B2%D0%BE%D1%80_20_%D0%B8%D1%8E%D0%BB%D1%8F\" title=\"\u0417\u0430\u0433\u043e\u0432\u043e\u0440 20 \u0438\u044e\u043b\u044f\">\u043f\u043e\u043a\u0443\u0448\u0435\u043d\u0438\u044f<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D1%82%D0%BB%D0%B5%D1%80,_%D0%90%D0%B4%D0%BE%D0%BB%D1%8C%D1%84\" title=\"\u0413\u0438\u0442\u043b\u0435\u0440, \u0410\u0434\u043e\u043b\u044c\u0444\">\u0413\u0438\u0442\u043b\u0435\u0440\u0430<\/a>, \u0432 \u0442\u043e\u043c \u0447\u0438\u0441\u043b\u0435 \u0444\u0435\u043b\u044c\u0434\u043c\u0430\u0440\u0448\u0430\u043b \u0444\u043e\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D1%86%D0%BB%D0%B5%D0%B1%D0%B5%D0%BD\" class=\"mw-disambig\" title=\"\u0412\u0438\u0446\u043b\u0435\u0431\u0435\u043d\">\u0412\u0438\u0446\u043b\u0435\u0431\u0435\u043d<\/a>, \u043f\u043e\u0432\u0435\u0448\u0435\u043d\u044b \u043d\u0430 \u0431\u0430\u0441\u043e\u0432\u044b\u0445 \u0441\u0442\u0440\u0443\u043d\u0430\u0445 \u0440\u043e\u044f\u043b\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1946_%D0%B3%D0%BE%D0%B4\" title=\"1946 \u0433\u043e\u0434\">1946 \u0433\u043e\u0434<\/a>&#160;\u2014 \u0434\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0445<\/a> \u0431\u043e\u043c\u0431\u0430\u0440\u0434\u0438\u0440\u043e\u0432\u0449\u0438\u043a\u0430 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b\u0438 \u043f\u043e\u043b\u0451\u0442 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B2%D0%B0%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2%D0%B0\" title=\"\u0413\u0430\u0432\u0430\u0439\u0441\u043a\u0438\u0435 \u043e\u0441\u0442\u0440\u043e\u0432\u0430\">\u0413\u0430\u0432\u0430\u0439\u0441\u043a\u0438\u0445 \u043e\u0441\u0442\u0440\u043e\u0432\u043e\u0432<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BB%D0%B8%D1%84%D0%BE%D1%80%D0%BD%D0%B8%D1%8F\" title=\"\u041a\u0430\u043b\u0438\u0444\u043e\u0440\u043d\u0438\u044f\">\u041a\u0430\u043b\u0438\u0444\u043e\u0440\u043d\u0438\u044e<\/a> \u0431\u0435\u0437 \u044d\u043a\u0438\u043f\u0430\u0436\u0430, \u043a\u043e\u043d\u0442\u0440\u043e\u043b\u0438\u0440\u0443\u0435\u043c\u044b\u0435 \u0438\u0441\u043a\u043b\u044e\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u043f\u043e \u0440\u0430\u0434\u0438\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1949_%D0%B3%D0%BE%D0%B4\" title=\"